message:
The untimely death of fellow {corpName} member {[character]charID.name, linkify}, on {[datetime]notification_created, date=full, time=none}, is a source of sorrow to me and their many friends in the corporation. Please accept our deepest sympathies in your bereavement. {[character]charID.name, linkify} was being reanimated at the cloning facility at the time when the fatal accident occurred.

{[character]charID.name, linkify} was a fine {roleName} and was admired by their fellow corporation members. {securityDescription} We will all miss them. I realize that words can do little to console you at a time like this, but I want you to know that we share your sorrow.

Sincerely, {corpName}

Dear {[character]ownerID.name},
A jump clone you had installed has been destroyed.

Location: {[location]locationID.name, linkify}

Location Owner: {[character]locationOwnerID.name, linkify}

Responsible party for the destruction: {[character]destroyerID.name, linkify}

