Dear {[character]charID.name},

My name is {[character]invokingCharID.name} and I would like you to join my corporation <b>{corporationName}</b>. You may choose to Accept the invitation which will move you to the corporation or alternatively you may Decline the application.

The invitation can be found in the Corporation window under the Recruitment “My Applications” tab.

Regards,
{[character]invokingCharID.name}
